import React, { Component } from "react";
import { Link } from "react-router-dom";
import faker from "faker";
import LoginForm from "./LoginForm";


class Nav extends Component {

    constructor(props) {
        super(props);

        this.state = {
            logo: faker.random.image(),
            showLogin: false,
        }
    }

    handleOnclickLogin = () => {
        console.log(this.state.showLogin)
        if (this.state.showLogin) {
            this.setState({ showLogin: false });
        } else {
            this.setState({ showLogin: true });
        }
    }

    handleSubmit = (event) => {
        event.preventDefault()
    }

    render() {
        return (

            <nav className={"top-menu"} >
                <ul>
                    <li>
                        <Link to="/">
                            <img src={this.state.logo} className={"nav-logo"} alt={"Logo"} />
                        </Link>
                    </li>
                    <li>
                        <Link to="/">
                            <button className={""}>Program</button>
                        </Link>
                    </li>
                    <li>
                        <Link to="/bookings">
                            <button className={""}>Bokningar</button>
                        </Link>
                    </li>
                    <li>
                        <form onSubmit={this.handleSubmit}>
                            <button className={""} onClick={this.handleOnclickLogin}>Logga In</button>
                        </form>
                        <LoginForm showClass={this.state.showLogin} />
                    </li>
                </ul>
            </nav >

        )
    }
}

export default Nav;
